// Dashboard.js
import React from 'react';
import axios from 'axios';

const Dashboard = ({ authData, onLogout }) => {
  const handleLogout = async () => {
    try {
      // Call the logout API
      await axios.post('http://localhost:5000/api/logout', {}, { withCredentials: true });

      // Clear user data and redirect
      onLogout();
    } catch (error) {
      console.error('Error during logout:', error);
      // Even if the API call fails, still log out on the frontend
      onLogout();
    }
  };

  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-12">
          <div className="card">
            <div className="card-header d-flex justify-content-between align-items-center">
              <h3>MOFSL Dashboard</h3>
              <button 
                className="btn btn-outline-danger" 
                onClick={handleLogout}
              >
                Logout
              </button>
            </div>
            <div className="card-body">
              <h5 className="card-title">Authentication Successful!</h5>
              <p className="card-text">Your account has been verified successfully.</p>

              {authData && (
                <div className="mt-4">
                  <h6>Authentication Details</h6>
                  <pre className="bg-light p-3 rounded">
                    {JSON.stringify(authData, null, 2)}
                  </pre>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
